    return (
     <div style={{height:"700px",boxShadow:"10px"}}>
     <div style={{backgroundColor:"white",width:"20%",float:"left",boxShadow:"20px",borderColor:"black"}} class="navbar navbar-inverse navbar-fixed-left">      
            <ViewAllCategoriesForCustomer/>
     </div>
     <div style={{marginLeft:"300px"}}> 
     <Product/>
        </div>
        </div>
    )
}
const mapStateToProps = state=>{
    console.log(state.product.products,"products    ")
    return{
        error:state.product.error,
        products:state.product.products
    }
}

export default connect(mapStateToProps)(Navbar)
